import React from 'react';
import logo from '../dog.svg'

function Navbar () {
  return (
    <nav>
      <img src={logo} alt="logo" width="10px" height="10px"/>
      <a href="#">Home</a>
      <a href="#">Services</a>
    </nav>
  );
}

export default Navbar;
